import './App.css';

function App() {
  const movies = [
    {name:'kathi',star:'3'},
    {name:'vadachennai',star:'5'},
    {name:'kakapo',star:'4.5'},
  ]
  return <div className ="App">
      {movies.map((name,key)=>{
        return <Movie name ={movies.name} star={movies.star}/>
      })}
  </div>

}
const Movie = (props) =>{
  return(
    <div>{props.name} {props.star}</div>
  )
}


export default App;
